import "./main.css";
// import logo from './logo.svg';
import "./App.css";
import { useState } from "react";

// data: id, name, colour, pricePerKg, imgUrl

function App() {
    const [data, setData] = useState([]);

    function getPosts() {
        fetch(
            "https://localhost:7089/breakfasts/3bf1b471-f515-4b4c-9b42-96f5eff32374"
        )
            .then((response) => response.json())
            // .then((json) => console.log(json));
            .then((json) => setData(json));
    }
    return (
        <div className="container">
            <h1 className="title">HTTP Request</h1>
            <button className="btn" onClick={getPosts}>
                Get posts
            </button>
            {console.log(data.id)}
            {
                <ul>
                    {data.name}, {data.pricePerKg * 4}, {data.imgUrl}
                </ul>
            }
        </div>
    );
}

export default App;
